import React from 'react';
import styled from 'styled-components'

const Background = styled.div`
    display: flex;
    position: fixed;
    flex-direction: row;
    background-color: #ACBCD2;
    height: 32px;
    padding: 10px;
    margin-bottom: 10%;
    width: 100%;
    align-items: center;
    z-index: 5;
`

const Title = styled.div`
    margin-right: 20px;
`

function ToolBar() {
    return(
        <>
        <Background>
            <Title>About</Title>
            <Title>Work</Title>
            <Title>Contact</Title>
            <Title>Reviews</Title>
        </Background>
        </>
    )
}

export default ToolBar;
